TITLE:
  - A multiphase porous medium (2D) example including transport and
  - reactions. Simple model for influence of haptotaxis on angiogenesis.
  - 'Four fluid phases:'
  - ^^^^^^^^^^^^^^^^^^
  - Healthy cells (HC)
  - Tumor cells (TC)
  - Interstitial fluid (IF)
  - Neovasculature (NV)
  - 'Five species:'
  - ^^^^^^^^^^^^^
  - Oxygen in IF
  - Necrotic cells (TC)
  - Tumor angiogenic factors (IF)
  - Oxygen in NV
  - Fibronectin in ECM
  - Angiogenesis takes place from a blood vessel on the right with
  - varying blood pressure.
  - 'Units are g, mm, s'
